  XW += x[16] * 1.5622800000000001e+02; // ETHYLNAPH-1
  XW += x[17] * 1.7025500000000000e+02; // PROPYLNAPH-1
  XW += x[18] * 1.8428199999999998e+02; // BUTYLNAPH-1
  XW += x[19] * 1.1817899999999999e+02; // INDANE
  XW += x[20] * 1.3220599999999999e+02; // TETRA
