  XW += x[59] * 3.1060999999999996e+02; // NC22H46
  XW += x[60] * 3.2463700000000000e+02; // NC23H48
  XW += x[61] * 9.8188999999999993e+01; // C6H11CH3
  XW += x[62] * 1.1221599999999999e+02; // C6H11C2H5
  XW += x[63] * 1.2624299999999999e+02; // C6H11C3H7
  XW += x[64] * 1.4026999999999998e+02; // C6H11C4H9
  XW += x[65] * 1.5429699999999997e+02; // C6H11C5H11
  XW += x[66] * 1.6832400000000001e+02; // C6H11C6H13
  XW += x[67] * 1.8235100000000000e+02; // C6H11C7H15
  XW += x[68] * 1.9637799999999999e+02; // C6H11C8H17
  XW += x[69] * 2.1040500000000000e+02; // C6H11C9H19
