  XW += x[76] * 1.3825399999999999e+02; // DECALIN
  XW += x[77] * 1.5228099999999998e+02; // METHYLDECALIN-2
  XW += x[78] * 1.6630799999999999e+02; // ETHYLDECALIN-2
