  XW += x[80] * 1.9436199999999999e+02; // BUTYLDECALIN-2
  XW += x[81] * 2.0838899999999998e+02; // PENTYLDECALIN-2
  XW += x[82] * 2.2241600000000000e+02; // HEXYLDECALIN-2
  XW += x[83] * 2.3644299999999998e+02; // HEPTYLDECALIN-2
  XW += x[84] * 1.3623800000000000e+02; // TRICYCLO-C10
